import React from "react";
import { MDBCol, MDBContainer, MDBRow, MDBFooter } from "mdbreact";

const FooterPage = () => {
  return (

    <MDBFooter
      style={{
        backgroundColor: "#E41A37",

      }}
      color="blue"
      className="font-small pt-4 mt-4 footer"
    >
      <MDBContainer fluid className="text-center text-md-left"></MDBContainer>
      <div className="footer-copyright text-center py-3">
        <MDBContainer style={{ color: "white" }} fluid>
          <p>
            {" "}
            &copy; {new Date().getFullYear()} Copyright: Mychal Martinez
            Basketball Member Portal
          </p>
        </MDBContainer>
      </div>
    </MDBFooter>
  );
};

export default FooterPage;
